import React, { useState } from 'react';
import './style.css';

const LifeMap = () => {
  const [stages] = useState([
    {
      title: '기초 학습',
      items: ['프로그래밍 언어 학습', '알고리즘과 자료구조 학습', '웹 기술 학습']
    },
    {
      title: '실전 프로젝트',
      items: ['개인 프로젝트 수행', '팀 프로젝트 참여', '버전 관리 시스템 사용']
    },
    {
      title: '전문 분야 탐색',
      items: ['백엔드 개발자', '프론트엔드 개발자', '데이터베이스 관리자']
    },
    {
      title: '실무 경험',
      items: ['인턴십 참여', '상업용 프로젝트 참여', '문제 해결 및 디버깅 경험']
    },
    {
      title: '전문성 강화',
      items: ['인증 자격증 취득', '컨퍼런스 및 워크샵 참석', '기술 블로그 작성']
    }
  ]);

  return (
    <div className="lifemap-container">
      <h1 className="lifemap-title">소프트웨어 개발자를 꿈꾸는 나의 로드맵</h1>
      <div className="lifemap-stages">
        {stages.map((stage, index) => (
          <div className="lifemap-stage" key={index}>
            <h2 className="lifemap-stage-title">{stage.title}</h2>
            <ul className="lifemap-stage-list">
              {stage.items.map((item, itemIndex) => (
                <li className="lifemap-stage-item" key={itemIndex}>
                  {item}
                </li>
              ))}
            </ul>
          </div>
        ))}
      </div>
    </div>
  );
};

export default LifeMap;
